import React, {useState}from 'react'
import './App.css'
import Nav from './Nav'

function Resume () {
  return (
    <div id='resume'>
      <Theme  />
      <Collapsible title='EDUCATION' content='test' />
      <Collapsible title='education' content='test' />
      <Collapsible title='education' content='test' />
      <Collapsible title='education' content='test' />
    </div>
  )
}

const Collapsible = props => {
    const [isOpen, setIsOpen] = useState(false);
    const [display, setDisplay] = useState({display:'none'});

    const changeDisplay = () => {
        if(isOpen){
            setIsOpen(false);
            setDisplay({display:"block"})
            console.log("close")
        }
        else{
            setIsOpen(true);
            setDisplay({display:'none'})
            console.log("open")
        }
    }

  return (
    <div id='resume-collapse'>
      <button type='button' className='collapsibleBT' onClick={changeDisplay}>
        {props.title}
      </button>
      <div className='collapsible-content' style={display}>{props.content}</div>
    </div>
  )
}

const Theme = () => {
  return (
    <div id='resume-title-box'>
      <span id='resume-title'>
        RESUME ON THE CLOUD, ACCESS ANYWHERE, WHENEVER YOU NEED
      </span>
      <Nav type='other' />
    </div>
  )
}

export default Resume
